INSERT INTO `smartend_banners` (`id`, `section_id`, `title_en`, `details_en`, `code`, `file_en`, `video_type`, `youtube_link`, `link_url`, `link_ar`, `link_en`, `link_ch`, `link_hi`, `link_es`, `link_ru`, `link_pt`, `link_fr`, `link_de`, `link_th`, `link_br`, `icon`, `status`, `visits`, `row_no`, `created_by`, `updated_by`, `created_at`, `updated_at`, `title_ku`, `details_ku`, `file_ku`, `link_ku`) VALUES
(1, 1, 'M. Muhammed Raffh', 'Muhammed Raffh, is a dedicated teacher of Qur’an and Islamic studies. With sincerity and passion, he strives to share authentic knowledge and inspire others to grow closer to Allah ﷻ through learning and practice.', NULL, '17568997045370.png', NULL, NULL, NULL, NULL, 'about-us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 1, 1, 1, '2025-09-03 05:01:41', '2025-09-22 08:05:37', 'م.محمد رافع', 'محەممەد ڕەفح، مامۆستایەکی خۆبەخشی قورئان و خوێندنی ئیسلامییە. بە دڵسۆزی و خولیاوە، هەوڵ دەدات زانیاری ڕاستەقینە بڵاوبکاتەوە و ئەوانی تر هان بدات لە ڕێگەی فێربوون و پراکتیکردنەوە نزیکتر بن لە خوای گەورە ﷻ.', '17568996691413.png', NULL),
(2, 1, 'Banner #2', 'It is a long established fact that a reader will be distracted by the readable content of a page. It is a long established fact that a reader will be distracted.', NULL, 'noimg.png', NULL, NULL, NULL, NULL, 'https://facebook.com', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 0, 2, 1, 1, '2025-09-03 05:01:41', '2025-09-22 08:03:56', 'Banner #2', 'It is a long established fact that a reader will be distracted by the readable content of a page. It is a long established fact that a reader will be distracted.', NULL, 'https://facebook.com'),
(3, 2, 'Accessible on Any Device', 'Learn anytime, anywhere with a fully responsive design for phones, tablets, and computers.', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'fa-object-group', 1, 0, 1, 1, 1, '2025-09-03 05:01:41', '2025-09-03 08:44:04', 'دەستپێگەیشتن لەسەر هەر ئامێرێک', 'فێربە هەر کاتێک، هەر شوێنێک بە دیزاینی تەواو وەڵامدەرەوە بۆ مۆبایل، تەبلێت و کۆمپیوتەر.', NULL, NULL),
(4, 2, 'Trusted & Authentic Knowledge', 'All content is based on the Qur’an and Sunnah, providing reliable and beneficial guidance.', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'fa-graduation-cap', 1, 0, 2, 1, 1, '2025-09-03 05:01:41', '2025-09-03 08:45:26', 'زانیاری پشتڕاست و باوەڕپێکراو', 'هەموو ناوەڕۆکەکان لەسەر قورئان و سوننە بنیات نراون، ڕێنماییەکی باوەڕپێکراو و سوودبەخش دەدەن.', NULL, NULL),
(5, 2, 'Connect with the Community', 'Engage, share, and grow in faith with a supportive online Islamic community.', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'fa-home', 1, 0, 3, 1, 1, '2025-09-03 05:01:41', '2025-09-03 08:47:30', 'پەیوەندی بکە بە کۆمەڵگە', 'بەژداربە، هاوبەشی بکە، و لە باوەڕدا پەرەوە بخە بە کۆمەڵگەیەکی ئیسلامی ئۆنڵاین و پشتگیریکەر.', NULL, NULL),
(6, 2, 'Simple & Inspiring Design', 'A clean, intuitive layout that makes learning easy and keeps your focus on faith.', NULL, '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'fa-laptop', 1, 0, 4, 1, 1, '2025-09-03 05:01:41', '2025-09-03 08:48:31', 'دیزاینی سادە و هەوڵبەخش', 'دیزاینێکی پاک و ئاسان کە فێربوون ئاسان دەکات و سەرنجت لەسەر باوەڕ دەهێڵێتەوە.', NULL, NULL);
