(1, 1, -1, 0, 'نافذة منبثقة للاشتراك في النشرة الإخبارية', 'Newsletter subscribe popup', '时事通讯订阅弹出窗口', 'न्यूज़लैटर सदस्यता पॉपअप', 'Ventana emergente de suscripción al boletín informativo', 'Всплывающее окно подписки на рассылку новостей', 'Pop-up de subscrição de newsletters', 'Fenêtre contextuelle d\'inscription à la newsletter', 'Popup zum Abonnieren des Newsletters', 'ป๊อปอัปสมัครรับจดหมายข่าว', 'Pop-up de inscrição no boletim informativo', '<br><div><h1>النشرة البريدية</h1><p>اشترك الآن في النشرة البريدية لدينا لتلقي آخر التحديثات.</p></div><br>', '<br><div><h1>Subscribe Now</h1><p>Sign up for our newsletter to receive the latest updates.</p></div><br>', '<br><div><h1>立即订阅</h1><p>注册我们的新闻通讯以接收最新更新。</p></div><br>', '<br><div><h1>अभी सदस्यता लें</h1><p>नवीनतम अपडेट प्राप्त करने के लिए हमारे न्यूज़लेटर के लिए साइन अप करें।</p></div><br>', '<br><div><h1>Suscríbete ahora</h1><p>Suscríbete a nuestro boletín para recibir las últimas novedades.</p></div><br>', '<br><div><h1>Подпишитесь сейчас</h1><p>Подпишитесь на нашу рассылку, чтобы получать последние обновления.</p></div><br>', '<br><div><h1>Inscreva-se já</h1><p>Subscreva a nossa newsletter para receber as últimas atualizações.</p></div><br>', '<br><div><h1>Abonnez-vous maintenant</h1><p>Inscrivez-vous à notre newsletter pour recevoir les dernières mises à jour.</p></div><br>', '<br><div><h1>Jetzt abonnieren</h1><p>Melden Sie sich für unseren Newsletter an, um die neuesten Updates zu erhalten.</p></div><br>', '<br><div><h1>สมัครสมาชิกทันที</h1><p>สมัครรับจดหมายข่าวของเราเพื่อรับข้อมูลอัปเดตล่าสุด</p></div><br>', '<br><div><h1>Assine agora</h1><p>Assine nossa newsletter para receber as últimas atualizações.</p></div><br>', 'newsletter.png', '{\"background_color\":\"#ffffff\",\"period\":\"0\",\"closable\":\"1\",\"delay\":\"5\",\"width\":\"700\",\"height\":\"320\",\"backdrop_opacity\":\"70\",\"photo_position\":\"1\"}', NULL, 1, 1, NULL, '2025-09-03 05:01:41', '2025-09-03 05:44:22', 'Newsletter subscribe popup', '<br><div><h1>Subscribe Now</h1><p>Sign up for our newsletter to receive the latest updates.</p></div><br>');
