(5, 'Home Welcome', '<div style=\"text-align: center\"><h1 style=\"margin-bottom: 15px; font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgba(0,=\"\" 0,=\"\" 0.87);\"=\"\">In the name of Allah, the Most Gracious, the Most Merciful</h1><h1><p style=\"font-size: 14.8px;\">Assalamu Alaikum wa Rahmatullahi wa Barakatuh, We warmly welcome you to our website, a place dedicated to sharing knowledge, faith, and inspiration rooted in the teachings of Islam. Here, you will find resources to strengthen your connection with Allah ﷻ, learn about the beauty of the Qur’an and Sunnah, and be reminded of the values of compassion, kindness, and unity. Our mission is to spread beneficial knowledge, encourage good deeds, and create a space where Muslims and seekers of truth can find guidance and peace. May Allah ﷻ bless your visit, increase you in wisdom, and grant us all success in this life and the Hereafter. JazakumAllahu Khairan for being here.</p></h1></div>', '2025-09-03', NULL, NULL, '17568991207447.png', '17586986808344.xlsx', NULL, NULL, NULL, 1, 10, 1, 0, 5, 14, NULL, NULL, NULL, NULL, NULL, 'home', 1, 1, '2025-09-03 05:01:41', '2025-09-24 04:24:40', 'Home Welcome', '<div style=\"text-align: center\"><h1 style=\"margin-bottom: 15px; font-family: Roboto, \" helvetica=\"\" neue\",=\"\" helvetica,=\"\" arial,=\"\" sans-serif;=\"\" color:=\"\" rgba(0,=\"\" 0,=\"\" 0.87);\"=\"\">بِسْمِ اللَّهِ الرَّحْمَـٰنِ الرَّحِيمِ</h1><p style=\"margin-bottom: 15px;\">سەڵام لەسەر ئێوە و ڕەحمەتی خوا و بەرەکەتەکانی، بە گەرمی پێشوازیتان لێدەکەین بۆ ماڵپەڕەکەمان، شوێنێک کە تەرخانکراوە بۆ هاوبەشکردنی زانیاری، باوەڕ و ئیلهام کە ڕەگی لە فێرکردنەکانی ئیسلامدا هەیە. لێرەدا سەرچاوەکان دەدۆزنەوە بۆ بەهێزکردنی پەیوەندیت لەگەڵ ئەڵڵا ﷻ، فێربوون لەسەر جوانی قورئان و سوننەت، و بیرکردنەوە لەسەر بەهاکانی بەزەیی، میهرەبانی و یەکگرتوویی. ئامانجمان بڵاوکردنەوەی زانیاری سوودبەخشە، هاندانی کارە چاکەکان، و دروستکردنی شوێنێکە کە موسڵمانان و ئەوانەی بەدوای ڕاستیدا دەگەڕێن بتوانن ڕێنمایی و ئارامی بدۆزنەوە. با ئەڵڵا ﷻ سەردانەکەتان بەرەکەتدار بکات، لە داناییدا زیادتان بکات، و بۆ هەموومان سەرکەوتن لەم ژیانەدا و دوایەدا بەخشێت. جەزاکوم ئەڵڵاهو خەیران بۆ ئەوەی لێرە ئامادەن.</p></div>', NULL, NULL, NULL, NULL, 'Home Welcome', '<div style=\"text-align: center\"><h1 style=\"margin-bottom: 15px; font-family: Roboto, \"Helvetica Neue\", Helvetica, Arial, sans-serif; color: rgba(0, 0, 0, 0.87);\">In the name of Allah, the Most Gracious, the Most Merciful.</h1><h1><p style=\"font-size: 14.8px;\">Assalamu Alaikum wa Rahmatullahi wa Barakatuh, We warmly welcome you to our website, a place dedicated to sharing knowledge, faith, and inspiration rooted in the teachings of Islam. Here, you will find resources to strengthen your connection with Allah ﷻ, learn about the beauty of the Qur’an and Sunnah, and be reminded of the values of compassion, kindness, and unity. Our mission is to spread beneficial knowledge, encourage good deeds, and create a space where Muslims and seekers of truth can find guidance and peace. May Allah ﷻ bless your visit, increase you in wisdom, and grant us all success in this life and the Hereafter. JazakumAllahu Khairan for being here.</p></h1></div>', NULL, NULL, NULL, NULL),
