(121, 'Following the Path of the Prophet ﷺ', '<div dir=\"ltr\"><span style=\"font-size: 14.8px; white-space-collapse: preserve;\">The Sunnah teaches us the practical application of Islamic principles. By following the example of Prophet Muhammad ﷺ, we develop noble character, meaningful worship, and a life rooted in mercy and justice.</span></div>', '2025-09-04', NULL, NULL, '17569716909158.png', NULL, NULL, NULL, NULL, 1, 23, 7, 0, 1, NULL, NULL, NULL, 'Following the Path of the Prophet ﷺ', 'The Sunnah teaches us the practical application of Islamic principles. By following the example of Prophet Muhammad ﷺ, we develop noble character, meaningful worship', NULL, 'following-the-path-of-the-prophet-ﷺ', 1, NULL, '2025-09-04 04:41:30', '2025-09-23 05:07:18', 'شوێنکەوتنی ڕێگای پێغەمبەر ﷺ', '<div dir=\"rtl\"><span style=\"font-size: 14.8px;\">سوننەت فێری ئەوەمان دەکات کە چۆن بنەماکانی ئیسلام بە شێوەیەکی کردەیی جێبەجێ بکەین. بە شوێنکەوتنی نموونەی پێغەمبەر محەمەد ﷺ، کارەکتەری ڕێزدار پەرەپێ دەدەین، عیبادەتێکی واتاداریمان دەبێت، و ژیانێک کە ڕەگی لە بەزەیی و دادپەروەریدا داکوتاوە.</span></div>', 'شوێنکەوتنی ڕێگای پێغەمبەر ﷺ', 'سوننەت فێری ئەوەمان دەکات کە چۆن بنەماکانی ئیسلام بە شێوەیەکی کردەیی جێبەجێ بکەین. بە شوێنکەوتنی نموونەی پێغەمبەر محەمەد ﷺ، کارەکتەری ڕێزدار پەرەپێ دەدەین، عیبادەتێک', NULL, 'شوێنکەوتنی-ڕێگای-پێغەمبەر-ﷺ', 'Following the Path of the Prophet ﷺ', '<div dir=\"ltr\"><span style=\"font-size: 14.8px; white-space-collapse: preserve;\">The Sunnah teaches us the practical application of Islamic principles. By following the example of Prophet Muhammad ﷺ, we develop noble character, meaningful worship, and a life rooted in mercy and justice.</span></div>', 'Following the Path of the Prophet ﷺ', 'The Sunnah teaches us the practical application of Islamic principles. By following the example of Prophet Muhammad ﷺ, we develop noble character, meaningful worship', NULL, NULL),
(122, 'The Divine Guidance For Live', '<div dir=\"ltr\"><span style=\"font-size: 14.8px; white-space-collapse: preserve;\">The Qur’an is the eternal message of Allah ﷻ, offering guidance, wisdom, and inspiration for every stage of life. Through its verses, we learn how to live with faith, integrity, and compassion in a world full of challenges.</span></div>', '2025-09-04', NULL, NULL, '17569717951707.png', NULL, NULL, NULL, NULL, 1, 27, 7, 0, 1, NULL, NULL, NULL, 'Following the Path of the Prophet ﷺ - Copy', 'The Sunnah teaches us the practical application of Islamic principles. By following the example of Prophet Muhammad ﷺ, we develop noble character, meaningful worship', NULL, 'following-the-path-of-the-prophet-ﷺ-1', 1, 1, '2025-09-04 04:42:11', '2025-09-23 05:07:18', 'ڕێنمایی ئیلاهی بۆ ژیان', '<div dir=\"rtl\"><span style=\"font-size: 14.8px;\">قورئان پەیامی هەتاهەتاییی ئەڵڵاهە ﷻ، ڕێنمایی و دانایی و ئیلهام پێشکەش دەکات بۆ هەموو قۆناغەکانی ژیان. لە ڕێگەی ئایەتەکانیەوە، فێری ئەوە دەبین کە چۆن بە ئیمان و ڕاستگۆیی و بەزەییەوە ژیان بکەین لە جیهانێکدا کە پڕە لە تەحەد</span></div>', 'شوێنکەوتنی ڕێگای پێغەمبەر ﷺ - Copy', 'سوننەت فێری ئەوەمان دەکات کە چۆن بنەماکانی ئیسلام بە شێوەیەکی کردەیی جێبەجێ بکەین. بە شوێنکەوتنی نموونەی پێغەمبەر محەمەد ﷺ، کارەکتەری ڕێزدار پەرەپێ دەدەین، عیبادەتێک', NULL, 'شوێنکەوتنی-ڕێگای-پێغەمبەر-ﷺ-1', 'The Divine Guidance For Live', '<div dir=\"ltr\"><span style=\"font-size: 14.8px; white-space-collapse: preserve;\">The Qur’an is the eternal message of Allah ﷻ, offering guidance, wisdom, and inspiration for every stage of life. Through its verses, we learn how to live with faith, integrity, and compassion in a world full of challenges.</span></div>', 'Following the Path of the Prophet ﷺ - Copy', 'The Sunnah teaches us the practical application of Islamic principles. By following the example of Prophet Muhammad ﷺ, we develop noble character, meaningful worship', NULL, NULL),
